import React from "react";
import { useHistory } from "react-router-dom/cjs/react-router-dom.min";
import { authService } from "../firebase";

export default () => {
    const history = useHistory();
    const onLogOutClick = () => {
        authService.signOut();
        history.push("/");
    };
    return (
        <>
            <button onClick={onLogOutClick}>Log Out</button>
        </>
    );
}
